import styled from 'styled-components';

export const HeaderContainer = styled.input`
  height: 48px;
  width: 360px;
  margin-top: 64px;
  margin-left: 120px;

  border: 1px solid #DDDDDD;
  box-sizing: border-box;
  border-radius: 4px;

  font-family: Open Sans;
  font-style: normal;
  font-weight: normal;
  font-size: 16px;
  line-height: 24px;
  text-indent: 16px;
  color: #333333;
`

